values:
That quiz was interesting.&nbsp;
I think i got like one right.
I guessed on the others.

But now we are getting yelled at.
Well, kinda.&nbsp;
Its not like a yell yell, is more like a "mommy yell".
If that makes sense.


Mmmmmmhm. and someone bitched at me in a comment, and an anonymous one at that, &nbsp;about the fact that I posted something about the old lady shooting the teen at the Wade Crossing apartments. And they didnt even have the guts to show who they were. Gayyy. Seriously guys, Why are some people so uptight?!&nbsp;


Anywho....I think i neeeeed to start reading the book.

Traffic was insane this morning.

It took us about two hours to get to college this morning.

We ended up missing the WHOLE class.&nbsp;

People cant really drive in this stuff.

They are kinda idiotic.


Buuuuut Kayla and i went to go talk to Dr. AC to make sure we knew what we missed.

And, i am actually feeling really comfortable about paper 1C.&nbsp;
Its exactly like what we used to do in AP English.&nbsp;&nbsp;
So, lets hope i can remember exactly how to do this.


Now I am off to finish paper 1B.
